package com.srn1535.java5features;

public class Boxingunboxing {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 10;
		int b = 15;
		Integer c = a + b;
		System.out.println("AutoBoxing::" + c);
		int d = c;
		System.out.println("AutoUnBoxing::" + d);
	}
}
